import React from 'react';
import classes from './Themes.css';
import Radium from 'radium';

const style = {
    firstContainer: {
        backgroundColor: 'rgb(127, 190, 174)',
        margin: '0px 2px',
        height: '550px',
    },
    secondContainer: {
        backgroundColor: 'rgb(127, 190, 174)',
        margin: '0px 2px',
        height: '550px',
    },
    thirdContainer: {
        backgroundColor: 'rgb(127, 190, 174)',
        margin: '0px 2px',
        height: '550px',
    }
}

const themes = (props) => {
    if (props.theme === 1)
    return (        
      <div className={classes.themes}>
          <div className={classes.modalMiddle}>
            <div className={classes.sectionTitle}>
            <p style={{color: 'rgb(147, 147, 147)', fontWeight: 'bold'}}><span style={{color: 'black'}}>À la maison,</span> qu’est-ce qui m’entoure dans mon appartement ?</p>
            </div>
            <div className={classes.fullWidthContainer}>
            <div className={classes.firstContainer}></div>
            <div className={classes.secondContainer}></div>
            <div className={classes.thirdContainer}></div>
            <div className={classes.fourthContainer}></div>
            </div>
        </div>
      </div>
    );
}

export default Radium(themes);
